import './Banner.css';
import backgroundImage from '/public/Image/banner.jpg';

const Banner = () => {
    return (
        <section className='banner' style={{backgroundImage: `url("/public/Image/banner.jpg")`}}>
            <h1>
                Sociedade Capirremoto
            </h1>
            <p>
                Bem vindo a Sociedade Capirremoto, Filhos da Capivara e afilhados do terremoto.
            </p>
        </section>
    );
}

export default Banner;
